import { useEffect } from 'react';
import childe from '../components/testComponent/childe'
import parent from '../components/testComponent/parent'

const test= () =>{

    console.log('test 컴포넌트'); 

    useEffect(()=>{
        console.log('test 리렌더링'); 
    })

return(
    <parent>
        <childe />
    </parent>
)

}

export default test;
